Kotlin Data Class: How generate an MongoDB ObjectId for an embedded document<p>I'm building an API with Spring Boot and Kotlin. I am trying to generate a structure the following way in MongoDB.</p>

<p><a href="https://i.stack.imgur.com/OZdwz.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/OZdwz.png" alt="enter image description here"></a></p>

<p>I understand that in MongoDb the concept of relationships between entities does not exist, so I will use the strategy of embedded documents. That is, to embed the Reunin in the Proyecto, and the Participante in the Reunin.</p>

<p>I have a main class called <code>Proyecto</code> and <code>NewProyecto</code>, that contains as property a list of reuniones of type <code>NewReunion</code>. I use two different classes to create and return data.</p>

<p><strong>Proyecto.kt</strong></p>

<pre><code>@Document(collection = "proyectos")
@TypeAlias("proyecto")
data class Proyecto (
        @Id
        val id: String,
        val nombre: String,
        val area: String,
        val fecha:String,
        val reuniones: List&lt;Reunion&gt;?
){}

@Document(collection = "proyectos")
@TypeAlias("newproyecto")
data class NewProyecto (
        @Id
        val id: String?,//Es posiblemente nulo porqu se crea automticamente
        var nombre: String,
        var area: String,
        var fecha:String,
        var reuniones: List&lt;NewReunion&gt;?
){}
</code></pre>

<p>Now, to create 'reuniones' I have two classes, <code>Reunion</code> and <code>NewReunion</code>. The class that corresponds to create a MongoDB embedded document is <code>NewReunion</code>. </p>

<p><strong>NewReunion.kt</strong></p>

<pre><code>@Document
data class Reunion(
        val objetivo: String,
        val fecha: String,
        val participantes: List&lt;Participante&gt;?
) {}

@Document
data class NewReunion(
        var id: String? = ObjectId().toHexString(),
        var fecha: String,
        var participantes: List&lt;NewParticipante&gt;?
) {}
</code></pre>

<p>This is where I have the problem. I want to generate an ObjectId for this <code>NewReunion</code> class, so that each object embedded in it has an <code>id</code>. The problem is that <code>ObjectId ().ToHexString()</code> is not generating any value at the time that the object of type <code>NewReunion</code> is built, but the other data that are <code>objetivo</code> and <code>fecha</code> are filled with the data that comes from the request POST.</p>

